import React from "react";
import { Button, Form, Input, message } from "antd";
import { useNavigate } from "react-router-dom";
import Header from "../../Components/Header";
import Footer from "../../Components/Footer";
import "./login-page.scss";

const LogInPage = () => {
  const navigate = useNavigate();

  const login = ({ myUsername, myPassword }) => {
    if (myUsername === "rick" && myPassword === "morty") {
      message.success("Login Successful!");
      localStorage.setItem("username", myUsername);
      localStorage.setItem("password", myPassword);
      navigate("/home");
    } else {
      message.error("Wrong credentials, please try again");
    }
  };

  return (
    <>
      <Header />
      <div className="div-login-page">
        <Form onFinish={login}>
          <Form.Item
            label="Username"
            name="myUsername"
            rules={[
              {
                required: true,
                message: "Please insert username",
              },
            ]}
          >
            <Input placeholder="USERNAME" />
          </Form.Item>
          <Form.Item
            label="Password"
            name="myPassword"
            rules={[
              {
                required: true,
                message: "Please insert password",
              },
            ]}
          >
            <Input.Password placeholder="PASSWORD" />
          </Form.Item>
          <Button type="default" htmlType="submit" block>
            LOG IN
          </Button>
        </Form>
      </div>
      <Footer />
    </>
  );
};

export default LogInPage;
